import React from 'react';
import {
  View,
  Text,
  StyleSheet,
  TouchableOpacity,
  ScrollView,
  Dimensions,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';

const { width } = Dimensions.get('window');

const HomeScreen = ({ navigation }) => {
  const menuItems = [
    {
      title: 'મૂળાક્ષરો',
      englishTitle: 'Alphabets',
      icon: 'text',
      screen: 'Alphabets',
      color: '#FF6B6B',
      description: 'Learn Gujarati vowels and consonants'
    },
    {
      title: 'અંક',
      englishTitle: 'Numbers',
      icon: 'calculator',
      screen: 'Numbers',
      color: '#4ECDC4',
      description: 'Learn Gujarati numbers 0-10'
    },
    {
      title: 'માત્રા',
      englishTitle: 'Diacritics',
      icon: 'language',
      screen: 'Diacritics',
      color: '#45B7D1',
      description: 'Learn vowel marks and symbols'
    },
    {
      title: 'બારાખડી',
      englishTitle: 'Barakhadi',
      icon: 'grid',
      screen: 'Barakhadi',
      color: '#96CEB4',
      description: 'Learn syllabic combinations'
    },
    {
      title: 'શબ્દો',
      englishTitle: 'Words',
      icon: 'book',
      screen: 'Words',
      color: '#FFEAA7',
      description: 'Learn 100+ Gujarati words'
    },
    {
      title: 'બાળવાર્તા',
      englishTitle: 'Stories',
      icon: 'library',
      screen: 'Stories',
      color: '#DDA0DD',
      description: 'Read Gujarati children stories'
    }
  ];

  return (
    <ScrollView style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.welcomeText}>સ્વાગત છે!</Text>
        <Text style={styles.englishWelcome}>Welcome!</Text>
        <Text style={styles.subtitle}>ગુજરાતી શીખવા માટે તૈયાર છો?</Text>
        <Text style={styles.englishSubtitle}>Ready to learn Gujarati?</Text>
      </View>

      <View style={styles.menuContainer}>
        {menuItems.map((item, index) => (
          <TouchableOpacity
            key={index}
            style={[styles.menuItem, { backgroundColor: item.color }]}
            onPress={() => navigation.navigate(item.screen)}
            activeOpacity={0.8}
          >
            <View style={styles.menuContent}>
              <Ionicons name={item.icon} size={40} color="white" />
              <View style={styles.menuText}>
                <Text style={styles.menuTitle}>{item.title}</Text>
                <Text style={styles.menuEnglishTitle}>{item.englishTitle}</Text>
                <Text style={styles.menuDescription}>{item.description}</Text>
              </View>
            </View>
          </TouchableOpacity>
        ))}
      </View>

      <View style={styles.footer}>
        <Text style={styles.footerText}>ગુજરાતી ભાષા શીખવાની મજા લો!</Text>
        <Text style={styles.footerEnglishText}>Have fun learning Gujarati!</Text>
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f8f9fa',
  },
  header: {
    backgroundColor: '#FF6B6B',
    padding: 30,
    alignItems: 'center',
    borderBottomLeftRadius: 30,
    borderBottomRightRadius: 30,
  },
  welcomeText: {
    fontSize: 32,
    fontWeight: 'bold',
    color: 'white',
    marginBottom: 5,
  },
  englishWelcome: {
    fontSize: 18,
    color: 'white',
    marginBottom: 15,
  },
  subtitle: {
    fontSize: 16,
    color: 'white',
    textAlign: 'center',
    marginBottom: 5,
  },
  englishSubtitle: {
    fontSize: 14,
    color: 'white',
    textAlign: 'center',
    opacity: 0.9,
  },
  menuContainer: {
    padding: 20,
  },
  menuItem: {
    marginBottom: 15,
    borderRadius: 15,
    elevation: 3,
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
  },
  menuContent: {
    flexDirection: 'row',
    alignItems: 'center',
    padding: 20,
  },
  menuText: {
    marginLeft: 15,
    flex: 1,
  },
  menuTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    color: 'white',
    marginBottom: 2,
  },
  menuEnglishTitle: {
    fontSize: 14,
    color: 'white',
    opacity: 0.9,
    marginBottom: 5,
  },
  menuDescription: {
    fontSize: 12,
    color: 'white',
    opacity: 0.8,
  },
  footer: {
    padding: 20,
    alignItems: 'center',
    marginBottom: 20,
  },
  footerText: {
    fontSize: 16,
    color: '#666',
    textAlign: 'center',
    marginBottom: 5,
  },
  footerEnglishText: {
    fontSize: 14,
    color: '#999',
    textAlign: 'center',
  },
});

export default HomeScreen;
